    override fun onCreate(savedInstanceState: Bundle?) {
        super.onCreate(savedInstanceState)

        viewModel = ViewModelProvider(this).get(ImageViewModel::class.java)
        binding = ActivityImageBinding.inflate(layoutInflater)
        setContentView(binding.root)
        application = applicationContext as MainApplication
        viewModel.my_seq.value = application!!.userData!!.u_seq.toString()
        binding!!.setLifecycleOwner(this)
        binding!!.viewModel = viewModel
        clickListeners()



        binding!!.rvMyCaBoard.viewTreeObserver
            .addOnGlobalLayoutListener(object : ViewTreeObserver.OnGlobalLayoutListener {
                override fun onGlobalLayout() {

                    viewModel?.rvWidth?.value  = binding?.rvMyCaBoard?.width
                    setAdapters()
                    binding!!.rvMyCaBoard.viewTreeObserver.removeOnGlobalLayoutListener(this)

                }
            })

        observes()
        viewModel.getImage()
    }


    private fun setAdapters() {
        adapter = ImageAdapter(this, arrayListOf(), viewModel) { data, tag, position ->
            if (application?.quick_view.equals("퀵유저")){
//                 ShowQuickUserDialog()
            }else {
                var i = Intent()
                i.putExtra("data", data.di_url)
                setResult(Activity.RESULT_OK, i)
                finish()
            }

        }

        binding?.rvMyCaBoard?.adapter = adapter

        binding?.rvMyCaBoard?.layoutManager = SpannedGridLayoutManager(object :
            SpannedGridLayoutManager.GridSpanLookup {
            override fun getSpanInfo(position: Int): SpannedGridLayoutManager.SpanInfo {
                   return SpannedGridLayoutManager.SpanInfo(1, 1)
            }
        },
            3 /* Three columns */,
            1f /* We want our items to be 1:1 ratio */
